import React from 'react';
import ReactDOM from 'react-dom';
import Navbar from './Navbar';
import Body from './Body.js';
import Footer from './Footer.js';
import './index.css';
import reportWebVitals from './reportWebVitals';

const objects=[
  {link:"Home", title:"Why React", body:"content"},
  {link:"Link1", title:"About React", body:"about content"},
  {link:"Link2", title:"React Products", body:"product contents"},
  {link:"Link3", title:"React Services", body:"services content"},
]

ReactDOM.render(
  <React.StrictMode>
    <Navbar myobjects={objects}/>

    <Footer/>
  </React.StrictMode>,
  document.getElementById('root')
);

//<Body/> put in navbar

//<Navbar home="Home" link1="Link1" link2="Link2" link3="Link3"/>
//<Navbar prop={test}/>
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
